import React, { Component } from "react";

export default class Categories extends Component {
  render() {
    return (
      <div>
        <div>
          <h1>Categories</h1>
          <ul>
            <li>Breakfast</li>
            <li>Lunch</li>
            <li>Supper</li>
            <li>Drinks</li>
            <li>Party</li>
            <li>Snacks</li>
          </ul>
        </div>
      </div>
    );
  }
}
